            Move_Two_Flag ? 'left_Move_Two' : '',
          ]">
            <p class='left_Move move2'>使用管理员账户或普通账户登入</p>
            <SHInput v-model='login.admin_Code' class='left_Move move3' type='text' placeholder='登录账号' autocomplete prop='admin_Code' />
            <SHInput v-model='login.pass_Word' class='left_Move move4' type='password' placeholder='登录密码' autocomplete prop='pass_Word'
                     @keydownenter='login_Operation' />
            <p class='left_Move move5' style='float: right; text-decoration: underline; cursor: pointer' @click="$Msg('请联系管理员')">
