              注册
            </button>
          </SHForm>
          <SHForm ref='form' :rules='rules' class='right_From public_From' :class="[
            Move_One_Flag ? 'right_Move_One' : '',
            Move_Two_Flag ? 'right_Move_Two' : '',
          ]">
            <p>请输入要注册的账户及密码</p>
            <SHInput v-model='reg.admin_Code' type='text' placeholder='注册账号' placeholder-color='#000' autocomplete prop='admin_Code' />
            <SHInput v-model='reg.pass_Word' type='password' placeholder='注册密码' autocomplete prop='pass_Word' style='margin-bottom: 20px'
                     @keydownenter='tourist_Reg' />
            <div v-if='slider_Reg_Toggle' ref='slider_Wrap' class='slider_Wrap'>
              <div ref='slider_Width' class='slider_Move_Info'/>
            </div>
            <button v-else class='left_Move move9' type='button' @click='tourist_Reg'>
              注册
            </button>
            <button class='left_Move move9' type='button' @click='back_Login'>
              返回登录页
