<script>
import { get_Token, reg_Admin } from '@/http/model/user.js'
import { mapMutations, mapActions } from 'vuex'
import { Login_Device_Code, bus, MD5 } from '@/until'
export default {
  data() {
    const checkAdmin = (value, calLback) => {
      if (
        /[`~!@#$%^&*()_\-+=<>?:"{}|,.\/;'\\[\]·~！@#￥%……&*（）——\-+={}|《》？：“”【】、；‘'，。、]/im.test(value) ||
        /[\u4e00-\u9fa5]/.test(value)
      ) {
        calLback('账号不允许特殊字符或者中文字符')
      } else {
        calLback()
      }
    }
    return {
      login: {
        admin_Code: '',
        pass_Word: ''
      },
      Move_One_Flag: false,
      Move_Two_Flag: false,
      slider_Reg_Toggle: false, // 注册滑块验证显隐
      reg: {
        admin_Code: '',
        pass_Word: ''
      },
      rules: {
        admin_Code: {
          minLen: { massage: '账号长度不能小于6位', numLen: 6 },
          maxLen: { massage: '账号长度不能大于12位', numLen: 12 },
          require: { massage: '请输入账号' },
          validator: { meth: checkAdmin }
        },
        pass_Word: {
          minLen: { massage: '密码长度不能小于6位', numLen: 6 },
          maxLen: { massage: '密码长度不能大于12位', numLen: 12 },
          require: { massage: '请输入密码' }
        }
      }
    }
  },
  methods: {
    ...mapMutations('login', ['session_Set_User']),
    ...mapActions('login', ['get_Router_Data']),
    ...mapActions('admin', ['get_Login_Admin']),
    // 登陆前socket验证此账号是否其他地点登录
    async login_Operation() {
      const { admin_Code } = this.login
      const pass_Word = MD5(this.login.admin_Code, this.login.pass_Word)
      this.$refs.formLogin.validate(async(c) => {
        if (!c && admin_Code !== 'root') return
        await this.get_Token_Methods()
        const Remote_Login = await this.get_Login_Admin({
          admin_Code,
          pass_Word
        })
        const { code, massage, Users, data } = Remote_Login
        if (code === 200) {
          // 单点登陆成功
          this.login_Account(Users)
        } else if (!data) {
          switch (code) {
            // 未注册
            case 403:
              this.login.admin_Code = ''
              this.login.pass_Word = ''
              break
            // 冻结
            case 405:
              this.login.admin_Code = ''
              this.login.pass_Word = ''
              break
            // 密码错误
            default:
              this.login.pass_Word = ''
              break
          }
          this.$Msg(massage, code === 403 ? 'wran' : 'faild')
          this.SK.disconnect()
          sessionStorage.clear()
        } else {
          // 多点登录判断是否强制退出
          this.$MsgBox(massage, 'faild')
            .then(() => {
              this.login_Account(Users)
              this.SK.socket.emit('Current_Out_Users', {
                admin_Code,
                login_Device: Login_Device_Code()
              })
            })
            .catch(() => {
              this.SK.disconnect()
              sessionStorage.clear()
              this.$Msg('正在取消登录')
            })
        }
      })
    },
    // 账号登录接口
    async login_Account(Users) {
      this.session_Set_User(Users)
      await this.get_Router_Data(Users.admin_Code)
      this.$router.push({ path: this.$route.query.path || '/Home' })
      // 调用socket聊天程序
      bus.$emit('receive_Message')
    },
    // 获取token
    get_Token_Methods() {
      return new Promise((resolve, reject) => {
        get_Token(MD5(this.login.admin_Code, this.login.pass_Word))
          .then((res) => {
            const { code, token, remainingTime } = res.data
            if (code === 200 && !remainingTime) {
              this.session_Set_User({ token })
              resolve()
            }
          })
          .catch((error) => reject(error))
      })
    },
    // 注册账号添加动画
    tourist_Reg() {
      this.$refs.form.validate(async(c) => {
        if (!c) return
        this.slider_Reg_Toggle = true
        this.$nextTick(_ => {
          this.$refs.slider.addEventListener(
            'mousedown',
            this.slider_Down,
            false
          )
          this.$refs.slider.addEventListener('mouseup', this.slider_Up, false)
        })
      })
    },
    // 滑块按下移动
    slider_Down(e) {
      const ev = e || window.event
      const target = ev.target || ev.srcElement
      if (target.className === 'slider_Move_Info') {
        this.$refs.slider_Width.style.transitionDuration = '0s'
        this.$refs.slider.addEventListener(
          'mousemove',
          this.slider_Move,
          false
        )
        this.offset_X_Down = e.offsetX
        this.clientWidth_Down = e.path[1].clientWidth
      }
    },
    // 滑块抬起验证失败返回初始值
    slider_Up() {
      if (this.offset_X_Distance < this.clientWidth_Down) {
        this.clear_slider_click()
      }
    },
    // 滑块移动验证成功注册失败恢复初始值
    slider_Move(e) {
      this.offset_X_Distance = e.offsetX - this.offset_X_Down + 40
      if (this.offset_X_Distance <= 40) {
        this.$refs.slider_Width.style.width = '40px'
      } else if (this.offset_X_Distance >= this.clientWidth_Down) {
        this.$refs.slider_Width.style.width = '100%'
        this.$refs.slider.removeEventListener(
          'mousemove',
          this.slider_Move,
          false
        )
        this.reg_Operation()
      } else {
        this.$refs.slider_Width.style.width = this.offset_X_Distance + 'px'
      }
      const ev = e || window.event
      const target = ev.target || ev.srcElement
      if (target.className !== 'slider_Move_Info') {
        this.clear_slider_click()
      }
    },
    // 注册接口
    reg_Operation() {
      this.$refs.form.validate(async(c) => {
        this.slider_Reg_Toggle = false
        if (!c) return this.$Msg('账号、密码已更改请重新验证', 'faild')
        this.$MsgBox('一旦注册，账号不可更改', 'faild')
          .then(() => {
            const { reg: { admin_Code }} = this
            const pass_Word = MD5(admin_Code, this.reg.pass_Word)
            reg_Admin({ admin_Code, pass_Word }).then((res) => {
              const { code, massage } = res.data
              if (code === 200) {
                this.back_Login()
              }
              this.reg.admin_Code = ''
              this.reg.pass_Word = ''
              this.$nextTick(_ => this.$refs.form.resetFields())
              this.$Msg(massage, code === 200 ? 'success' : 'wran')
            })
          })
          .catch(() => {
            this.$Msg('正在取消注册')
          })
        this.slider_Reg_Toggle = false
      })
    },
    // 滑块恢复初始值动画
    clear_slider_click() {
      this.$refs.slider_Width.className = 'slider_Move_Faild'
      this.$refs.slider_Width.style.transitionDuration = '.5s'
      this.$refs.slider_Width.style.width = '40px'
      this.$refs.slider.removeEventListener(
        'mousemove',
        this.slider_Move,
        false
      )
      const timer = setTimeout(() => {
        this.$refs.slider_Width.className = 'slider_Move_Info'
        clearTimeout(timer)
      }, 1000)
    },
    // 前往注册页
    tourist_Reg_Go() {
      this.Move_One_Flag = true
      this.Move_Two_Flag = false
    },
    // 返回登录页
    back_Login() {
      this.Move_One_Flag = false
      this.Move_Two_Flag = true
      this.slider_Reg_Toggle = false
    },
    // 游客登录
    tourist_Login() {
      this.$router.push({ name: 'Home' })
    }
  }
}
</script>

